import React from "react";

function ConnectMe({ gitSrc, linkedinSrc }) {
    return (
        <div className="flex absolute bottom-0 left-0 m-10 space-x-4">
            <a href="https://www.linkedin.com/in/balqees-khanfar-b91b85194/">
                <img src={linkedinSrc} className="w-10 h-10" alt="linked in" />
            </a>
            <a href="https://github.com/balqeeskhanfar">
                <img src={gitSrc} className="w-10 h-10" alt="git hub" />
            </a>
        </div>
    );
}

export default ConnectMe;
